package com.denny.DataStory.PDF;

import com.itextpdf.text.Document;
import com.itextpdf.text.DocumentException;
import com.itextpdf.text.Image;
import com.itextpdf.text.pdf.PdfWriter;
import sun.misc.BASE64Decoder;

import java.io.*;

/**
 * @Description
 * @auther denny
 * @create 2020-03-10 11:57
 */
public class JavaToPdfFromBase64 {

    public static void main(String[] args) throws IOException {
        String base64Info = "data:image/png;base64,";
        String newFileName = "5.pdf";
        String newPngName = newFileName.replaceFirst(".pdf", ".png");
        String exportFilePath = "D:\\work\\tool\\src\\main\\resources\\PDF\\";
        base64Info = base64Info.replaceAll(" ", "+");
        BASE64Decoder decoder = new BASE64Decoder();
        String[] arr = base64Info.split("base64,");
        byte[] buffer;

        try {
            buffer = decoder.decodeBuffer(arr[1]);
        } catch (IOException e) {
            throw new RuntimeException();
        }
        OutputStream output = null;
        try {
            output = new FileOutputStream(new File(exportFilePath+newPngName));//生成png文件
            output.write(buffer);
            output.flush();
            output.close();
        } catch (Exception e) {
            e.printStackTrace();
        }
        Pdf(exportFilePath+newPngName,exportFilePath+newFileName);

        File f = new File(exportFilePath+newPngName);
//        f.delete();
//        f.createNewFile();

        System.out.println("结束");

    }

    //通过png文件来生成pdf文件
    public static File Pdf(String imagePath, String mOutputPdfFileName) {
        Document doc = new Document();
        try {
            PdfWriter writer = PdfWriter.getInstance(doc, new FileOutputStream(mOutputPdfFileName));
            doc.open();
            doc.newPage();
            Image png1 = Image.getInstance(imagePath);
//            float heigth = png1.getHeight();
//            float width = png1.getWidth();
//            int percent = getPercent2(heigth, width);
//            png1.setAlignment(Image.MIDDLE);
//            png1.setAlignment(Image.TEXTWRAP);
//            png1.setWidthPercentage(210);
//            png1.scalePercent(percent + 3);
            doc.add(png1);
            doc.close();
            writer.close();
        } catch (FileNotFoundException e) {
            e.printStackTrace();
        } catch (DocumentException e) {
            e.printStackTrace();
        } catch (IOException e) {
            e.printStackTrace();
        }

        File mOutputPdfFile = new File(mOutputPdfFileName);
        if (!mOutputPdfFile.exists()) {
            mOutputPdfFile.deleteOnExit();
            return null;
        }
        return mOutputPdfFile;
    }

    private static int getPercent2(float h, float w) {
        int p = 0;
        float p2 = 0.0f;
        p2 = 530 / w * 100;
        p = Math.round(p2);
        return p;
    }

}
